import React, { Component } from 'react'
import {NavLink} from 'react-router-dom'
import './graph.css'

export class HomeComponent extends Component {
    render() {
        return (
            <center>
            <div>
                <h1 className="heading" style={{color:'darkblue'}}>
                    GRAPH ALGORITHM VISUALISER
                </h1>
                
                <NavLink to='/bfsdfs'>Graph Traversal Algo</NavLink>
                &nbsp;&nbsp;&nbsp;&nbsp;
                <NavLink to='/dijkstra'>Shortest Path Algo</NavLink>
                &nbsp;&nbsp;&nbsp;&nbsp;
                <NavLink to='/KruskalMST'>Kruskal's Minimal Spanning Tree</NavLink>
                &nbsp;&nbsp;&nbsp;&nbsp;
                <NavLink to='/PrimMST'>Prim's Minimal Spanning Tree</NavLink>
            </div>
            </center>
        )
    }
}

export default HomeComponent
